import React from 'react';
import {Link} from 'react-router-dom';

function Navbar1() {
    return (
        <nav style={{height:"100%", width:"30%"}}>
            <ul id="navbar1">
                <li>
                    <Link to="/"><h1>College Kitchen</h1></Link>
                </li>
                <li>
                    <Link to="/About">About</Link>
                </li>
                <li>
                    <Link to="/">Menu</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar1;
